void Power::getNode(const VectorXT &v1, const VectorXT &v2, const VectorXT &v3, TV &node) {
    assert(v1.rows() == 3 && v2.rows() == 3 && v3.rows() == 3);

    double x1 = v1(0);
    double y1 = v1(1);
    double z1 = v1(2);
    double x2 = v2(0);
    double y2 = v2(1);
    double z2 = v2(2);
    double x3 = v3(0);
    double y3 = v3(1);
    double z3 = v3(2);

//    double rsq2 = (x2 - x1) * (x2 - x1) + (y2 - y1) * (y2 - y1);
//    double d2 = 0.5 + 0.5 * (z2 - z1) / rsq2;
//    double xp2 = x1 + d2 * (x2 - x1);
//    double yp2 = y1 + d2 * (y2 - y1);
//    double xl2 = -(y2 - y1);
//    double yl2 = (x2 - x1);
//    double rsq3 = (x3 - x1) * (x3 - x1) + (y3 - y1) * (y3 - y1);
//    double d3 = 0.5 + 0.5 * (z3 - z1) / rsq3;
//    double xp3 = x1 + d3 * (x3 - x1);
//    double yp3 = y1 + d3 * (y3 - y1);
//    double xl3 = -(y3 - y1);
//    double yl3 = (x3 - x1);
//
//    double a2 = (yl3 * (xp3 - xp2) - xl3 * (yp3 - yp2)) / (xl2 * yl3 - xl3 * yl2);
//    double xn = xp2 + a2 * xl2;
//    double yn = yp2 + a2 * yl2;
//
//    node = {xn, yn};

    double xn, yn;
    // @formatter:off
    xn = ((x3 - x1) * ((0.5e0 + (0.5e0 * z3 - 0.5e0 * z1) / (pow(x3 - x1, 0.2e1) + pow(y3 - y1, 0.2e1))) * (x3 - x1) - (0.5e0 + (0.5e0 * z2 - 0.5e0 * z1) / (pow(x2 - x1, 0.2e1) + pow(y2 - y1, 0.2e1))) * (x2 - x1)) - (-y3 + y1) * ((0.5e0 + (0.5e0 * z3 - 0.5e0 * z1) / (pow(x3 - x1, 0.2e1) + pow(y3 - y1, 0.2e1))) * (y3 - y1) - (0.5e0 + (0.5e0 * z2 - 0.5e0 * z1) / (pow(x2 - x1, 0.2e1) + pow(y2 - y1, 0.2e1))) * (y2 - y1))) / ((y1 - y2) * (x3 - x1) - (-y3 + y1) * (x2 - x1)) * (y1 - y2) + x1 + (0.5e0 + (0.5e0 * z2 - 0.5e0 * z1) / (pow(x2 - x1, 0.2e1) + pow(y2 - y1, 0.2e1))) * (x2 - x1);
    yn = ((x3 - x1) * ((0.5e0 + (0.5e0 * z3 - 0.5e0 * z1) / (pow(x3 - x1, 0.2e1) + pow(y3 - y1, 0.2e1))) * (x3 - x1) - (0.5e0 + (0.5e0 * z2 - 0.5e0 * z1) / (pow(x2 - x1, 0.2e1) + pow(y2 - y1, 0.2e1))) * (x2 - x1)) - (-y3 + y1) * ((0.5e0 + (0.5e0 * z3 - 0.5e0 * z1) / (pow(x3 - x1, 0.2e1) + pow(y3 - y1, 0.2e1))) * (y3 - y1) - (0.5e0 + (0.5e0 * z2 - 0.5e0 * z1) / (pow(x2 - x1, 0.2e1) + pow(y2 - y1, 0.2e1))) * (y2 - y1))) / ((y1 - y2) * (x3 - x1) - (-y3 + y1) * (x2 - x1)) * (x2 - x1) + y1 + (0.5e0 + (0.5e0 * z2 - 0.5e0 * z1) / (pow(x2 - x1, 0.2e1) + pow(y2 - y1, 0.2e1))) * (y2 - y1);
    // @formatter:on
    node = {xn, yn};
}

